import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Home from './pages/Home'; 
import Survey from './pages/Survey';

import { BrowserRouter as Router } from 'react-router-dom'

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <Route path="/">
        <Home /> 
      </Route>
      <Route path="/survey">
        <Survey /> 
      </Route>
    </Router>
    <Home />
  </React.StrictMode>,
  document.getElementById('root')
);
